import React from "react";

function App() {
  return (
    <>
      <table border="1">
        <th>번호</th>
        <th>제목</th>
        <th>작성자</th>
        <th>작성일</th>
        <th>조회수</th>
      </table>
    </>
  );
}

export default App;
